const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "quickstart"
    }}>{`Quickstart`}</h1>
    <p>{`This tutorial covers installing all the tools you'll need to design metadata documents with AML and shows you how to get up and running quickly.`}</p>
    <h2 {...{
      "id": "before-you-begin"
    }}>{`Before you begin`}</h2>
    <p>{`Prerequisites:`}</p>
    <ul>
      <li parentName="ul">{`JVM: version 7 or higher`}</li>
      <li parentName="ul">{`SBT to build the AMF command-line`}</li>
    </ul>
    <h2 {...{
      "id": "download-the-example"
    }}>{`Download the example`}</h2>
    <p>{`You can download the example from the AML project `}<a parentName="p" {...{
        "href": "https://github.com/aml-org/examples"
      }}>{`examples repository`}</a>{` in Github.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
git clone https://github.com/aml-org/examples.git
cd examples

`}</code></pre>
    <h2 {...{
      "id": "build-and-install-the-amf-command-line-tool"
    }}>{`Build and install the AMF command-line tool`}</h2>
    <p>{`Download AMF from its github repository and build AMF command-line (you will need `}<a parentName="p" {...{
        "href": "https://www.scala-sbt.org/"
      }}>{`Scala SBT`}</a>{`):`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
git clone https://github.com/aml-org/amf.git
cd amf
sbt buildCommandLine

`}</code></pre>
    <p>{`This will leave a versioned fat jar (amf-X.Y.Z-SNAPSHOT.jar) in the top-level repository of the project.
Copy this jar file to the top-level of the `}<a parentName="p" {...{
        "href": "https://github.com/aml-org/examples"
      }}>{`examples repository`}</a>{`:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
cp ./amf-X.Y.Z-SNAPSHOT.jar ../examples/amf.jar

`}</code></pre>
    <h2 {...{
      "id": "defining-an-aml-dialect-for-a-new-type-of-metadata-documents"
    }}>{`Defining an AML Dialect for a new type of metadata documents`}</h2>
    <p>{`In this example we will define a new type of metadata document to exchange information about geographical locations.`}</p>
    <p>{`First, we will define a new type of AML Dialect describing the structure of the document, located in the `}<a parentName="p" {...{
        "href": "https://github.com/aml-org/examples"
      }}>{`examples repository`}</a>{` in the file `}<inlineCode parentName="p">{`aml/quickstart/dialects/places.yaml`}</inlineCode>{`:`}</p>
    <p><em parentName="p">{`places.yaml`}</em></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`
#%Dialect 1.0

dialect: Places
version: 1.0

external:
  schema: http://schema.org/

nodeMappings:

  LocationNode:
    classTerm: schema.Place
    mapping:
      name:
        propertyTerm: schema.name
        mandatory: true
        range: string
      image:
        propertyTerm: schema.image
        range: uri

documents:
  root:
    encodes: LocationNode

`}</code></pre>
    <p>{`The dialect is very simple. It just defines a document with a couple of nodes: one for the place, and the other for an image of the place. We are using the `}<a parentName="p" {...{
        "href": "http://schema.org"
      }}>{`Schema.org`}</a>{` vocabulary to provide the semantics of the metadata.`}</p>
    <p>{`You can check the validity of this AML Dialect using AMF. From the top-level directory of the `}<a parentName="p" {...{
        "href": "https://github.com/aml-org/examples"
      }}>{`examples repository`}</a>{`:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
examples [master] $ java -jar amf.jar validate -in "AML 1.0" -mime-in application/yaml file://aml/quickstart/dialects/places.yaml
{
  "@type": "http://www.w3.org/ns/shacl#ValidationReport",
  "http://www.w3.org/ns/shacl#conforms": true
}

`}</code></pre>
    <h2 {...{
      "id": "parsing-metadata-documents"
    }}>{`Parsing metadata documents`}</h2>
    <p>{`Having a valid AML Dialect, we can start using it to parse metadata documents with information about different places.`}</p>
    <p>{`For example, we can try the `}<inlineCode parentName="p">{`golden_gate.yaml`}</inlineCode>{` document:`}</p>
    <p><em parentName="p">{`golden_gate.yaml`}</em></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`
#%Places 1.0

name: Golden Gate
image: https://en.wikipedia.org/wiki/Golden_Gate#/media/File:Golden_Gate_1.jpg

`}</code></pre>
    <p>{`We can use AMF to parse and validate the example, passing as an argument the location of the dialect and dialect instance to be parsed:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
examples [master] $ java -jar amf.jar parse -ds file://aml/quickstart/dialects/places.yaml -in "AML 1.0" -mime-in application/yaml -ctx true file://aml/quickstart/golden_gate.yaml

`}</code></pre>
    <p>{`The following JSON-LD document will be returned in the console:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-json"
      }}>{`
[
  {
    "@id": "#",
    "@type": [
      "meta:DialectInstance",
      "doc:Document",
      "doc:Fragment",
      "doc:Module",
      "doc:Unit"
    ],
    "meta:definedBy": [
      {
        "@id": "file://aml/quickstart/dialects/places.yaml#"
      }
    ],
    "doc:encodes": [
      {
        "@id": "#/",
        "@type": [
          "schema-org:Place",
          "file://aml/quickstart/dialects/places.yaml#/declarations/LocationNode",
          "meta:DialectDomainElement",
          "doc:DomainElement"
        ],
        "schema-org:image": [
          {
            "@id": "https://en.wikipedia.org/wiki/Golden_Gate#/media/File:Golden_Gate_1.jpg"
          }
        ],
        "schema-org:name": [
          {
            "@value": "Golden Gate"
          }
        ]
      }
    ],
    "@context": {
      "@base": "file://aml/quickstart/golden_gate.yaml",
      "doc": "http://a.ml/vocabularies/document#",
      "meta": "http://a.ml/vocabularies/meta#",
      "schema-org": "http://schema.org/"
    }
  }
]

`}</code></pre>
    <p><a parentName="p" {...{
        "href": "https://json-ld.org/"
      }}>{`JSON-LD`}</a>{` is a `}<a parentName="p" {...{
        "href": "https://www.w3.org/TR/json-ld/"
      }}>{`W3C standard`}</a>{` to store graphs of information with support for hyperlinks. JSON-LD is the native format for AMF-parsed graph models.`}</p>
    <h2 {...{
      "id": "using-vocabularies-for-custom-semantics"
    }}>{`Using vocabularies for custom semantics`}</h2>
    <p>{`AML allows users to define the semantics for metadata documents in AML Vocabulary files.`}</p>
    <p>{`The file `}<inlineCode parentName="p">{`aml/quickstart/geolocation.yaml`}</inlineCode>{` contains a vocabulary defining a few terms for a custom geolocation vocabulary:`}</p>
    <p><em parentName="p">{`geolocation.yaml`}</em></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`
#%Vocabulary 1.0

vocabulary: Geolocation

base: http://myorg.com/vocabs/geo#

classTerms:

  Point:
    description: Single coordinate pair

  Line:
    description: Pair of points

  Polygon:
    description: contains at least 4 coordinate points

propertyTerms:

  position:
    description: Geolocation of an element
    range: Point

  latitude:
    description: Geographical latitude

  longitude:
    description: Geographical longitude

`}</code></pre>
    <p>{`We could modify our dialect to generate a new version that uses the AML Vocabulary for geolocation we have just reviewed:`}</p>
    <p><em parentName="p">{`places_2.yaml`}</em></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`
#%Dialect 1.0

dialect: Places
version: 1.1

uses:
  geo: ../vocabularies/geolocation.yaml

external:
  schema: http://schema.org/

nodeMappings:

  LocationNode:
    classTerm: schema.Place
    mapping:
      name:
        propertyTerm: schema.name
        mandatory: true
        range: string
      image:
        propertyTerm: schema.image
        range: uri
      location:
        mandatory: true
        propertyTerm: geo.position
        range: CoordinatesNode

  CoordinatesNode:
    classTerm: geo.Point
    mapping:
      lat:
        propertyTerm: geo.latitude
        mandatory: true
        range: double
      long:
        propertyTerm: geo.longitude
        mandatory: true
        range: double

documents:
  root:
    encodes: LocationNode

`}</code></pre>
    <p>{`Now, we can parse documents that include geographical coordinates like:`}</p>
    <p><em parentName="p">{`golden_gate_2.yaml`}</em></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`
#%Places 1.1

name: Golden Gate
image: https://en.wikipedia.org/wiki/Golden_Gate#/media/File:Golden_Gate_1.jpg
location:
  lat: 37.81
  long: 122.5

`}</code></pre>
    <p>{`The geographical information will appear in the graph using the semantic terms defined in our geolocation vocabulary:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
examples [master] $ java -jar amf.jar parse -ds file://aml/quickstart/dialects/places_2.yaml -in "AML 1.0" -mime-in application/yaml -ctx true file://aml/quickstart/golden_gate_2.yaml
[
  {
    "@id": "#",
    "@type": [
      "meta:DialectInstance",
      "doc:Document",
      "doc:Fragment",
      "doc:Module",
      "doc:Unit"
    ],
    "meta:definedBy": [
      {
        "@id": "file://aml/quickstart/dialects/places_2.yaml#"
      }
    ],
    "doc:encodes": [
      {
        "@id": "#/",
        "@type": [
          "schema-org:Place",
          "file://aml/quickstart/dialects/places_2.yaml#/declarations/LocationNode",
          "meta:DialectDomainElement",
          "doc:DomainElement"
        ],
        "schema-org:image": [
          {
            "@id": "https://en.wikipedia.org/wiki/Golden_Gate#/media/File:Golden_Gate_1.jpg"
          }
        ],
        "schema-org:name": [
          {
            "@value": "Golden Gate"
          }
        ],
        "http://myorg.com/vocabs/geo#position": [
          {
            "@id": "#/location",
            "@type": [
              "http://myorg.com/vocabs/geo#Point",
              "file://aml/quickstart/dialects/places_2.yaml#/declarations/CoordinatesNode",
              "meta:DialectDomainElement",
              "doc:DomainElement"
            ],
            "http://myorg.com/vocabs/geo#longitude": [
              {
                "@value": 122.5
              }
            ],
            "http://myorg.com/vocabs/geo#latitude": [
              {
                "@value": 37.81
              }
            ]
          }
        ]
      }
    ],
    "@context": {
      "@base": "file://aml/quickstart/golden_gate_2.yaml",
      "doc": "http://a.ml/vocabularies/document#",
      "meta": "http://a.ml/vocabularies/meta#",
      "schema-org": "http://schema.org/"
    }
  }
]

`}</code></pre>
    <h2 {...{
      "id": "validating-metadata-documents"
    }}>{`Validating metadata documents`}</h2>
    <p>{`If we try to parse an invalid document, the parser will fail and return an error message with a list of errors and syntactic information about the location of the error.
As an example, you can try to parse the `}<inlineCode parentName="p">{`aml/quickstart/piccadilly_circus_error.yaml`}</inlineCode>{` document in the examples. In this document, geographical coordinates are provided as strings instead of double values:`}</p>
    <p><em parentName="p">{`piccadilly_circus_error.yaml`}</em></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`
#%Places 1.1

name: Piccadilly Circus
image: https://commons.wikimedia.org/wiki/File:Open_Happiness_Piccadilly_Circus_Blue-Pink_Hour_120917-1126-jikatu.jpg#/media/File:Open_Happiness_Piccadilly_Circus_Blue-Pink_Hour_120917-1126-jikatu.jpg
location:
  lat: "51.30 N"
  long: "0.8 W"

`}</code></pre>
    <p>{`Parsing the document throws a textual error in the console:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`
examples [master] $ java -jar amf.jar parse -ds file://aml/quickstart/dialects/places_2.yaml -in "AML 1.0" -mime-in application/yaml -ctx true file://aml/quickstart/piccadilly_circus_error.yaml
Model: file://aml/quickstart/piccadilly_circus_error.yaml#
Profile: AMF
Conforms? false
Number of results: 2

Level: Violation

- Source: http://a.ml/vocabularies/amf/parser#inconsistent-property-range-value
  Message: Cannot find expected range for property http://myorg.com/vocabs/geo#latitude (lat). Found 'http://www.w3.org/2001/XMLSchema#string', expected 'http://www.w3.org/2001/XMLSchema#double'
  Level: Violation
  Target: file://aml/quickstart/piccadilly_circus_error.yaml#/location
  Property: http://myorg.com/vocabs/geo#latitude
  Position: Some(LexicalInformation([(6,7)-(6,16)]))

- Source: http://a.ml/vocabularies/amf/parser#inconsistent-property-range-value
  Message: Cannot find expected range for property http://myorg.com/vocabs/geo#longitude (long). Found 'http://www.w3.org/2001/XMLSchema#string', expected 'http://www.w3.org/2001/XMLSchema#double'
  Level: Violation
  Target: file://aml/quickstart/piccadilly_circus_error.yaml#/location
  Property: http://myorg.com/vocabs/geo#longitude
  Position: Some(LexicalInformation([(7,8)-(7,15)]))

`}</code></pre>
    <p>{`To get the error report as a machine-friendly graph encoded using JSON-LD, the `}<inlineCode parentName="p">{`validate`}</inlineCode>{` AMF command must be used.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
